export class StrangeNewWorldsUniformPack extends BaseNeckProvider implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.StrangeNewWorlds) + StrangeNewWorldsUniforms.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.StrangeNewWorlds)
                + StrangeNewWorldsUniforms.averageFemaleBodyBase + StrangeNewWorldsUniforms.averageFemaleBodyTop, BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformAndVariantBody(token: Token) {
        let division = DivisionColors.getDivision(token.uniformEra, token.divisionColor);
        let result = "";
        switch (token.bodyType) {
            case BodyType.AverageMale: {
                result = StrangeNewWorldsUniforms.averageMaleBody;
                if (division === Division[Division.Command]) {
                    result += OriginalSeriesMaleBodyCommandSymbol;
                } else if (division === Division[Division.Science]) {
                    result += OriginalSeriesMaleBodyScienceSymbol;
                } else if (division === Division[Division.Operations]) {
                    result += OriginalSeriesMaleBodyEngineeringSymbol;
                }
                break;
            }
            case BodyType.AverageFemale:
                result = StrangeNewWorldsUniforms.averageFemaleBodyBase;
                let pattern = "";
                let patternColor = SimpleColor.from(token.divisionColor).darken().asHex();
                if (division === Division[Division.Command]) {
                    pattern = StrangeNewWorldsUniforms.averageFemaleBodyFlair.command.replace(/#970f0f/g, patternColor);
                    result += StrangeNewWorldsUniforms.deltaSymbolFemale.command;
                } else if (division === "Science" || division === "Medical" || division === "Nursing") {
                    if (division === "Science") {
                        pattern = StrangeNewWorldsUniforms.averageFemaleBodyFlair.science.replace(/#970f0f/g, patternColor);
                    } else {
                        patternColor = SimpleColor.from(token.divisionColor).darken(0.25).asHex();
                        pattern = StrangeNewWorldsUniforms.averageFemaleBodyFlair.medicine.replace(/#970f0f/g, patternColor);
                    }
                    result += StrangeNewWorldsUniforms.deltaSymbolFemale.science;
                } else if (division === Division[Division.Operations]) {
                    pattern = StrangeNewWorldsUniforms.averageFemaleBodyFlair.operations.replace(/#970f0f/g, patternColor);
                    result += StrangeNewWorldsUniforms.deltaSymbolFemale.operations;
                }
                result += pattern + StrangeNewWorldsUniforms.averageFemaleBodyTop;
                break;
            default:
        }

        return this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.OriginalSeries)
            + result.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getRankSwatches() {
        return [
            new Swatch(Rank.None, "None", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch("", Rank.None, token), "Rank.none.name"),
            new Swatch(Rank.Ensign, "Ensign", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(RankIndicators.ensign + RankIndicators.swatchOutline, Rank.Ensign, token), "Rank.ensign.name"),
            new Swatch(Rank.LieutenantJG, "Lieutenant J.G.", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(RankIndicators.lieutenantJG + RankIndicators.swatchOutline, Rank.LieutenantJG, token), "Rank.lieutenantJG.name"),
            new Swatch(Rank.Lieutenant, "Lieutenant", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(RankIndicators.lieutenant + RankIndicators.swatchOutline, Rank.Lieutenant, token), "Rank.lieutenant.name"),
            new Swatch(Rank.LtCommander, "Lt. Commander", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(RankIndicators.ltCommander + RankIndicators.swatchOutline, Rank.LtCommander, token), "Rank.ltCommander.name"),
            new Swatch(Rank.Commander, "Commander", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(RankIndicators.commander + RankIndicators.swatchOutline, Rank.Commander, token), "Rank.commander.name"),
            new Swatch(Rank.Captain, "Captain", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(RankIndicators.captain + RankIndicators.swatchOutline, Rank.Captain, token), "Rank.captain.name")
        ];
    }

    getRankIndicator(token: Token) {
        return "";
    }

    getRankBorderIndicator(token: Token) {
        const barColour = StrangeNewWorldsUniformPack.getRankIndicatorColor(token.divisionColor);
        switch (token.rankIndicator) {
            case Rank.Ensign:
                return RankIndicators.ensign.replace(DefaultRed, token.divisionColor).replace(/#970f0f/g, barColour) + RankIndicators.borderOutline;
            case Rank.LieutenantJG:
                return RankIndicators.lieutenantJG.replace(DefaultRed, token.divisionColor).replace(/#970f0f/g, barColour) + RankIndicators.borderOutline;
            case Rank.Lieutenant:
                return RankIndicators.lieutenant.replace(DefaultRed, token.divisionColor).replace(/#970f0f/g, barColour) + RankIndicators.borderOutline;
            case Rank.LtCommander:
                return RankIndicators.ltCommander.replace(DefaultRed, token.divisionColor).replace(/#970f0f/g, barColour) + RankIndicators.borderOutline;
            case Rank.Commander:
                return RankIndicators.commander.replace(DefaultRed, token.divisionColor).replace(/#970f0f/g, barColour) + RankIndicators.borderOutline;
            case Rank.Captain:
                return RankIndicators.captain.replace(DefaultRed, token.divisionColor).replace(/#970f0f/g, barColour) + RankIndicators.borderOutline;
            default:
                return "";
        }
    }

    getBorderColor(token: Token) {
        if (token.variant === UniformVariantType.Variant1 && DivisionColors.getDivision(UniformEra.OriginalSeries, token.divisionColor) === "Command"
                && token.rankIndicator === Rank.Captain) {
            return "#88966c";
        } else {
            return token.divisionColor;
        }
    }


    getRankBorderDefinitions(token: Token, bordered: boolean) {
        return "";
    }

    static decorateRankSwatch(svg: string, rankIndicator: Rank, token: Token) {
        return `<svg viewBox="0 0 80 80" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
            <defs>
                <clipPath id="rankClipPath` + rankIndicator + `">
                    <circle cx="40" cy="40" r="40" fill="#ffffff" />
                </clipPath>
            </defs>
            <g clip-path="url(#rankClipPath` + rankIndicator + `">
                <g transform="translate(-65, -318)">`
        + svg.replace(DefaultRed, token.divisionColor).replace(/#970f0f/g, StrangeNewWorldsUniformPack.getRankIndicatorColor(token.divisionColor))
        + `</g>
        + </g>
        </svg>`;
    }

    static getRankIndicatorColor(divisionColor: string) {
        let base = SimpleColor.from(divisionColor);
        return base.isDark ? base.lighten(0.4).asHex() : base.darken(0.25).asHex();
    }

    getBorderLogo(token: Token): string {
        let division = DivisionColors.getDivision(token.uniformEra, token.divisionColor);
        if (division === Division[Division.Command]) {
            return StrangeNewWorldsInsignia.base + StrangeNewWorldsInsignia.command;
        } else if (division === Division[Division.Operations]) {
            return StrangeNewWorldsInsignia.base + StrangeNewWorldsInsignia.operations;
        } else {
            return StrangeNewWorldsInsignia.base + StrangeNewWorldsInsignia.science;
        }
    }

    isDivisionColorSupported(token: Token): boolean {
        return true;
    }
}

